import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { ApiService } from '../api.service';

@Component({
  selector: 'app-diabetic',
  templateUrl: './diabetic.component.html',
  styleUrls: ['./diabetic.component.scss']
})
export class DiabeticComponent implements OnInit {
  form!: FormGroup;
  formData: any;


  constructor(private formBuilder: FormBuilder, private apiService: ApiService) { }

  ngOnInit(): void {
    this.form = this.formBuilder.group({
      age: ['', Validators.required],
      pregnancies: ['', Validators.required],
      glucose: ['', Validators.required],
      blood_pressure: ['', Validators.required],
      skin_thickness: ['', Validators.required],
      insulin: ['', Validators.required],
      bmi: ['', Validators.required],
      diabetes_pedigree_function: ['', Validators.required]
    });

    this.form.valueChanges.subscribe(value => {
      this.formData = value;
    });
  }

  onSubmit() {
    if (this.form.valid) {

      this.apiService.diabetesData(this.formData.age, this.formData.pregnancies, this.formData.glucose, this.formData.blood_pressure,  this.formData.skin_thickness, this.formData.insulin,  this.formData.bmi, this.formData.diabetes_pedigree_function)
        .subscribe(
          response => {
            console.log('API call successful:', response);

          },
          error => {
            console.error('API call error:', error);

          }
        );
    }
  }
}
<div class="card">
  <div class="card-header">
    <h2>Diabetes</h2>
  </div>
  <div class="card-body">
    <form [formGroup]="form" (ngSubmit)="onSubmit()" class="form-container">
      <div class="form-row">
        <div class="form-group">
          <label for="age">Age</label>
          <input type="number" formControlName="age" id="age" required>
        </div>
        <div class="form-group">
          <label for="pregnancies">Pregnancies</label>
          <input type="number" formControlName="pregnancies" id="pregnancies" required>
        </div>
      </div>
      <div class="form-row">
        <div class="form-group">
          <label for="glucose">Glucose</label>
          <input type="number" formControlName="glucose" id="glucose" required>
        </div>
        <div class="form-group">
          <label for="blood_pressure">Blood Pressure</label>
          <input type="number" formControlName="blood_pressure" id="blood_pressure" required>
        </div>
      </div>
      <div class="form-row">
        <div class="form-group">
          <label for="skin_thickness">Skin Thickness</label>
          <input type="number" formControlName="skin_thickness" id="skin_thickness" required>
        </div>
        <div class="form-group">
          <label for="insulin">Insulin</label>
          <input type="number" formControlName="insulin" id="insulin" required>
        </div>
      </div>
      <div class="form-row">
        <div class="form-group">
          <label for="bmi">BMI</label>
          <input type="number" formControlName="bmi" id="bmi" required>
        </div>
        <div class="form-group">
          <label for="diabetes_pedigree_function">Diabetes Pedigree Function</label>
          <input type="number" formControlName="diabetes_pedigree_function" id="diabetes_pedigree_function" required>
        </div>
      </div>
      <button type="submit" [disabled]="!form.valid">Submit</button>
    </form>
  </div>
</div>
